  private final TrailPoint[] sourcePoints = new TrailPoint[xyArrayIn.length/2];

  private final QuadInterpolator quadInterpolator = new QuadInterpolator(true);

  @Test
  public void shouldInterpolateCurve() {
    // given
    quadInterpolator.setDensity(1);
    QuadCurveArray quadCurveArray = quadInterpolator.getQuadCurveArray();
    fillSourcePoints();
    // do
    interpolate();
    // then
    Assert.assertEquals(xyArrayExpected.length / 2 - 1, quadCurveArray.getLastPointIndex());
    for (int i = 0; i <= quadCurveArray.getLastPointIndex(); i++) {
      TrailPoint expected = new TrailPoint(xyArrayExpected[2*i], xyArrayExpected[2*i+1]);
      Assert.assertTrue(expected.isSameAs(quadCurveArray.get(i)));
    }
  }

  private void interpolate() {
    TrailPoint trailPoint;
    quadInterpolator.reset();
    for (int i = 0; i < sourcePoints.length - 1; i++) {
      trailPoint = sourcePoints[i];
      quadInterpolator.newPointAdded(trailPoint.getX(), trailPoint.getY());
    }
    trailPoint = sourcePoints[sourcePoints.length-1];
    quadInterpolator.lastPointAdded(trailPoint.getX(), trailPoint.getY());
  }

  private void fillSourcePoints() {
    for (int i = 0; i < sourcePoints.length; i++) {
      sourcePoints[i] = new TrailPoint(xyArrayIn[2*i], xyArrayIn[2*i+1]);
    }
  }
